-- 테이블 pplus.goods 구조 내보내기
DROP TABLE IF EXISTS `b1_goods`;
CREATE TABLE IF NOT EXISTS `b1_goods` (
  `seq_no` bigint NOT NULL AUTO_INCREMENT COMMENT '상품 순번',
  `pg_seq_no` bigint NOT NULL COMMENT '상품 상점 페이지 순번',
  `go_category_seq_no` bigint NOT NULL COMMENT '상품 카테고리 순번',
  `go_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '상품명',
  `go_hashtag` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '해쉬태그',
  `go_description` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '상품 설명',
  `go_count` bigint NOT NULL DEFAULT '-1' COMMENT '상품 수량,  -1 : 수량 제한 없음',
  `go_status` int NOT NULL DEFAULT 1 COMMENT '상품상태  1:판매중(sail), 0:완판(soldOut), -1:판매종료(expire), -2: 판매중지(stop)',
  `go_goods_prop` varchar(4096) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '상품 옵션',
  `reg_datetime` datetime NOT NULL COMMENT '등록시각',
  `mod_datetime` datetime NOT NULL COMMENT '변경시각',
  `go_price` float NOT NULL COMMENT '상품 가격',
  `go_expire_datetime` datetime DEFAULT NULL,
  `go_attachments` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '상품 이미지 리스트',
  `go_sold_count` bigint NOT NULL DEFAULT 0 COMMENT '상품 누적 판매 수량',
  `go_lang` varchar(8) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'ko' COMMENT '언어',
  `go_type` int NOT NULL DEFAULT 0 COMMENT '0 : 메뉴 오더 상품, 1 : 일반 구매 상품',
  `go_reward_luckybol` int NOT NULL DEFAULT 0 COMMENT '상품에 걸린 리워드 럭키볼 수',
  `go_origin_price` float NOT NULL COMMENT '상품 원 가격',
  `go_expire_day` int DEFAULT NULL COMMENT '구 매 후 사용처리 유효 기간',
  `go_is_hotdeal` BIT NOT NULL DEFAULT 0 COMMENT '핫딜 상품 여부',
  `go_is_plus` BIT NOT NULL DEFAULT 0 COMMENT '플러스 상품 여부',
  `go_start_time` time DEFAULT NULL COMMENT '상품 구매 시작 시간',
  `go_end_time` time DEFAULT NULL COMMENT '상품 구매 종료 시간',
  `go_reward_pr_link` int DEFAULT 0 COMMENT 'PRLink 를 통해서 구매 시 리워드 럭키볼 수',
  `go_news_datetime` datetime DEFAULT NULL COMMENT '최신 소식으로 등록 시각',
  `go_reward_pr_review_link` int DEFAULT 0 COMMENT '구매 리뷰 광고를 통해서 구매 시 리워드 럭키볼 수',
  PRIMARY KEY (`seq_no`),
  KEY `category_seq_no` (`go_category_seq_no`),
  KEY `page_seq_no` (`pg_seq_no`),
  KEY `expire_datetime` (`go_expire_datetime`),
  KEY `price` (`go_price`),
  KEY `lang` (`go_lang`),
  KEY `expire_day` (`go_expire_day`),
  KEY `is_hotdeal` (`go_is_hotdeal`),
  KEY `is_plus` (`go_is_plus`),
  KEY `start_time` (`go_start_time`),
  KEY `end_time` (`go_end_time`),
  KEY `news_datetime` (`go_news_datetime`)
) DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

