/*!40000 ALTER TABLE `b1_goods` ENABLE KEYS */;

-- 테이블 pplus.page 구조 내보내기
DROP TABLE IF EXISTS `b1_page`;
CREATE TABLE IF NOT EXISTS `b1_page` (
  `seq_no` bigint NOT NULL AUTO_INCREMENT,
  `mb_seq_no` bigint NOT NULL,
  `pg_coop_seq_no` bigint DEFAULT NULL,
  `pg_coop_status` varchar(32) NOT NULL DEFAULT 'normal',
  `pg_status` varchar(32) NOT NULL DEFAULT 'normal',
  `pg_page_name` varchar(64) NOT NULL,
  `pg_code` varchar(32) DEFAULT NULL,
  `pg_phone_number` varchar(20) DEFAULT NULL,
  `pg_open_bounds` varchar(32) NOT NULL DEFAULT 'everybody',
  `pg_zip_code` varchar(10) DEFAULT NULL,
  `pg_road_address` varchar(128) DEFAULT NULL,
  `pg_road_detail_address` varchar(128) DEFAULT NULL,
  `pg_parcel_address` varchar(128) DEFAULT NULL,
  `pg_parcel_detail_address` varchar(128) DEFAULT NULL,
  `pg_latitude` double DEFAULT NULL,
  `pg_longitude` double DEFAULT NULL,
  `pg_catchphrase` varchar(128) DEFAULT NULL,
  `pg_introduction` varchar(1024) DEFAULT NULL,
  `pg_category_text` varchar(128) DEFAULT NULL,
  `pg_today_view_count` bigint NOT NULL DEFAULT 0,
  `pg_total_view_count` bigint NOT NULL DEFAULT 0,
  `pg_blind` enum('Y','N') NOT NULL DEFAULT 'Y',
  `pg_talk_receive_bounds` varchar(32) DEFAULT 'everybody',
  `pg_talk_deny_day` varchar(64) DEFAULT NULL,
  `pg_talk_deny_start_time` time DEFAULT NULL,
  `pg_talk_deny_end_time` time DEFAULT NULL,
  `pg_customer_count` int NOT NULL DEFAULT 0,
  `pg_plus_count` int NOT NULL DEFAULT 0,
  `pg_main_movie_url` varchar(1024) DEFAULT NULL,
  `pg_page_prop` text,
  `reg_datetime` datetime DEFAULT NULL,
  `mod_datetime` datetime DEFAULT NULL,
  `pg_page_type` varchar(32) NOT NULL DEFAULT 'store',
  `pg_page_level` int NOT NULL DEFAULT 1,
  `pg_modifier_seq_no` bigint DEFAULT NULL,
  `pg_profile_seq_no` bigint DEFAULT NULL,
  `pg_bg_seq_no` bigint DEFAULT NULL,
  `pg_valuation_count` bigint NOT NULL DEFAULT 0,
  `pg_valuation_point` bigint NOT NULL DEFAULT 0,
  `pg_offer_res_datetime` datetime DEFAULT NULL,
  `pg_virtual_page` enum('Y','N') NOT NULL DEFAULT 'N',
  `pg_search_keyword` varchar(512) DEFAULT NULL,
  `pg_auth_code` varchar(8) DEFAULT NULL,
  `pg_incorrect_auth_code_count` int NOT NULL DEFAULT 0,
  `pg_agent_seq_no` bigint DEFAULT NULL,
  `pg_recommendation_code` varchar(32) DEFAULT NULL,
  `pg_settlement_url` varchar(512) DEFAULT NULL,
  `pg_main_goods_seq_no` bigint DEFAULT NULL,
  `pg_is_seller` BIT DEFAULT 1 COMMENT '상품판배 가능 여부',
  `pg_is_link` BIT NOT NULL DEFAULT 0 COMMENT '링크 페이지 여부',
  `pg_homepage_link` varchar(1024) DEFAULT NULL COMMENT '홈 페이지 링크',
  `pg_hashtag` varchar(255) DEFAULT NULL COMMENT '해쉬태그',
  `pg_thema_seq_no` bigint DEFAULT NULL COMMENT '테마 카테고리 순번',
  `pg_is_holiday_closed` BIT NOT NULL DEFAULT 0 COMMENT '휴일 휴무 유무',
  `pg_delivery_radius` double DEFAULT NULL COMMENT '배달 반경',
  `pg_is_shop_orderable` BIT DEFAULT 0 COMMENT '매자 결제 가능여부',
  `pg_is_packing_orderable` BIT NOT NULL DEFAULT 0 COMMENT '포장주문',
  `pg_is_delivery_orderable` BIT NOT NULL DEFAULT 0 COMMENT '배달주문',
  `pg_delivery_fee` float DEFAULT NULL COMMENT '배달비',
  `pg_delivery_min_price` float DEFAULT NULL COMMENT '배달가능 최소 주문금액',
  `pg_is_parking_available` BIT NOT NULL DEFAULT 0 COMMENT '주차가능여부',
  `pg_is_valet_parking_available` BIT NOT NULL DEFAULT 0 COMMENT '발렛주차가능여부',
  `pg_is_chain` BIT NOT NULL DEFAULT 0 COMMENT '체인점 여부',
  `pg_is_delivery` BIT NOT NULL DEFAULT 0 COMMENT '배달대행 여부',
  `pg_parent_seq_no` bigint DEFAULT NULL COMMENT '체인점 지점인 경우만 본점 페이지 순번 값이 있고 그외에는 null',
  `pg_use_prnumber` BIT DEFAULT 0 COMMENT 'prnumber 사용여부',
  PRIMARY KEY (`seq_no`),
  KEY `is_seller` (`pg_is_seller`),
  KEY `thema_seq_no` (`pg_thema_seq_no`),
  KEY `main_goods_seq_no` (`pg_main_goods_seq_no`),
  KEY `is_shop_orderable` (`pg_is_shop_orderable`),
  KEY `is_packing_orderable` (`pg_is_packing_orderable`),
  KEY `is_delivery_orderable` (`pg_is_delivery_orderable`),
  KEY `delivery_radius` (`pg_delivery_radius`),
  KEY `is_chain` (`pg_is_chain`),
  KEY `is_delivery` (`pg_is_delivery`),
  KEY `parent_seq_no` (`pg_parent_seq_no`),
  KEY `latitude` (`pg_latitude`,`pg_longitude`)
) DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

